    string itemName;
    int quantity;
    double itemPrice, totalPrice;

    cout << "Enter customer's name: "; //prompts customer for name 
    getline(cin, customerName); //takes in customer name with spaces 

    cout << "\nEnter item name: "; //prompts for item name 
    getline(cin, itemName); //takes in item name with spaces

    cout << "\nEnter quantity purchased: "; //prompts for quantity purchased 
    cin >> quantity;

    cout << "\nEnter price per item: "; //prompts for price per item 
    cin >> itemPrice;

     //calculates total price 
     totalPrice = quantity * itemPrice;

     //sets decimal precision to 2 
     cout << fixed << showpoint << setprecision(2);

     //displays receipt 

     cout << "\n\n\t\t\tRECEIPT" << endl << endl;

     cout << "\tCustomer Name: "<< customerName<< endl<<endl;;

     cout << "\tItem Name: \t"<<itemName<<endl<<endl;;

     cout << "\tQuantity: \t"<<quantity<<endl<<endl;;

     cout << "\tPrice Per Item:\t$"<<itemPrice<<endl<<endl;;

     cout << "\tTotal Price: \t$"<<totalPrice<<endl;;

